import style from "./Nav.module.css";
import { useState } from "react";
import Ac from "@material-ui/icons/Search";
import Mi from "@material-ui/icons/Menu";
const Nav = () => {
  const [dis, changedis] = useState(false);
  const [dis2, changedis2] = useState(false);
  const fun1 = () => {
    changedis(true);
  };
  const fun2 = () => {
    changedis(false);
    changedis2(false);
  };

  const fun3 = () => {
    changedis2(true);
  };
  return (
    <div className={style.navmain}>
      <div id={style.navsub}>
        <div id={style.logo}>
          <p id={style.mainlabel}>
            TBB<sup id={style.sup}>TM</sup>
          </p>
        </div>
        <div id={style.searchbar}>
          <input id={style.navsearch} type="text" />

          <Ac id={style.searchicon} />
        </div>

        <div id={style.menubtn}>
          <Mi id={style.mbtn} />
        </div>

        <div id={style.navitems}>
          <div
            className={style["navitem1"]}
            onMouseLeave={fun2}
            onMouseMoveCapture={fun1}
          >
            <p className={style.paraitem}>Products</p>
          </div>
          <div id={style.navitem2}>
            <p className={style.paraitem}>Cart</p>
          </div>
          <div id={style.navitem3}>
            <p className={style.paraitem}>User</p>
          </div>
        </div>
      </div>
      {dis && (
        <div className={style["onHover"]} onMouseMoveCapture={fun3}>
          <p>Men</p>
          <p>Women</p>
          <p>Kids</p>
        </div>
      )}
      {dis2 && (
        <div className={style["onHover2"]} onMouseMoveCapture={fun3}>
          <p>Men</p>
          <p>Women</p>
          <p>Kids</p>
        </div>
      )}
    </div>
  );
};

export default Nav;
